import React from "react";
import { Grid } from "@material-ui/core";

function Dotsx({ GotoDots, slides, activeSlide }: any): JSX.Element {
  return (
    <Grid
      container
      style={{
        position: "absolute",
        bottom: "6vh",
        width: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        zIndex: 2,
      }}
    >
      {slides.map((slide: any, i: any) => (
        <span
          className="turdark"
          key={i}
          onClick={() => {
            GotoDots(i);
          }}
          style={{
            backgroundColor: "rgba(255,255,255,0.8)",
            opacity: activeSlide === i ? 0.8 : 0.35,
            padding: "7px",
            marginRight: "5px",
            cursor: "pointer",
            borderRadius: "50%",
          }}
        >
          {" "}
        </span>
      ))}
    </Grid>
  );
}

export const Dots = React.memo(Dotsx);
